import PopupWithForm from "./PopupWithForm";

function ConfirmPopup({ isOpen, onClose, onCardDelete, card, valueInput}) {
    function handleSubmit(event) {
        event.preventDefault();
        onCardDelete(card);

    }

    return (
        <PopupWithForm
            name="popup-confirm"
            title="Вы уверены?"
            value={valueInput.confirm}
            isOpen={isOpen}
            onClose={onClose}
            handleSubmit={handleSubmit}
        ></PopupWithForm>
    );
}

export default ConfirmPopup;
